recommandationVideos.Description:
Tällä videolla puhutaan siitä, millaista on olla sosiaalisen median ammattilainen. Äänessä ovat somen supernaiset Patricia Ström ja Derya Dincer. 
@PatriciaStromElisabeth @DeryaDincer1 
Yhteys: iriz.silander@gmai.com

Teräketjut, erikoislattaviilat (Vallorbe), pakoputket, ilmansuodattimet, sovitepalat yms. Videolla testailen muutamia tuotteita sahoihin ja kohtapa näitä päästään kokeilemaan käytännössä.

Alla linkit kivijalaka liikkeisiin joita kyllä suosittelen ja vahvasti:

@https://www.puukaatuu.fi/

ja

